import React, { useState } from "react";
import Button from "react-bootstrap/Button";

const ListaUsuarios = () => {
  return (
    <>
      <header>
        <h2> Liste todos os usuários </h2>
      </header>
      <main>
        <div className="list-users">
          <Button variant="primary" id="btn-list">
            Listar
          </Button>
        </div>
      </main>
    </>
  );
};

export default ListaUsuarios;
